"If set to \"y\", offers the user to filter articles based on a minimum and a maximum rating." => "Wenn \"Y\" eingetragen wird, kann der Benutzer die Artikel nach minimalen und maximalen Bewertungen filtern ",
"If set to a category identifier, only lists the articles in the specified category." => "Wenn eine Kategorie angegeben wird, werden nur Artikel in dieser Kategorie aufgelistet.",
"If set to a list of article topic names separated by plus signs, only lists the articles in the specified article topics. If the string is preceded by an exclamation mark (\"!\"), the effect is reversed, i.e. articles in the specified article topics are not listed." => "Wenn eine Liste von Artikelthemen, getrennt durch Pluszeichen, eingetragen wird, werden nur die Artikel gelistet mit den angegebenen Themen. Wird ein Ausrufezeichen \"!\" vorangestellt, wird der Effekt umgekehrt, d.h. Artikel mit den angegebenen Themen werden nicht gelistet.",
