"Preformated sections" => "Vorformatierte Bereiche",
"~pp~ data ~/pp~ Displays preformated text/code; no Wiki processing is done inside these sections (as with np), and the spacing is fixed (no word wrapping is done).  ~pre~ data ~/pre~ also displayes preformatted text with fixed spacing, but wiki processing still occurs on the text." => "~pp~ Text ~/pp~ Zeigt vorformatierten Text/Code; es findet keine Wikibearbeitung des Textes mehr statt (so wie np). Auch Abstände sind fixiert (es findet kein Zeilenumbruch statt).  ~pre~ Text ~/pre~ macht das Gleiche wie ~pp Text ~/pp; nur wird der Text Wikibearbeitet.",
"~tc~ Tiki Comment ~/tc~ makes a Tiki comment.  It will be completely removed from the display, but saved in the file for future reference.  ~hc~ HTML Comment ~/hc~ makes an HTML comment.  It will be inserted as a comment in the output HTML; these are not normally displayed in browsers, but can be seen using \"View Source\" or similar." => "~tc~ Text ~/tc~ erstellt einen Tikikommentar.  Dieser ist nicht sichtbar, wird aber zusammen mit der Datei zu künftigen Nachweisen abgespeichert.  ~hc~ Text ~/hc~ fügt einen HTML-Kommentar ein.  Er wird als Kommentar im HTML-Output eingefügt und kann dann vom Browser über die Quelltextanzeige angezeigt werden.",
"Block Preformatting" => "Block Vorformatierung",
"Insert resp. right-to-left and left-to-right text direction DIV (up to end of text) and markers for langages as arabic or hebrew." => "Fügt ein DIV für die Textschreibrichtung recht-nach-links bzw. links-nach-rechts-ein. Außerdem eine Kennzeichnung für die Sprache als Arabisch und Herbräisch.",
